(1, 6, 'paper', '<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:16.0pt;font-family:&quot;Swiss721BT-Light&quot;,sans-serif;mso-bidi-font-family:\nSwiss721BT-Light\">Next Word Prediction using BI-LSTM<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:16.0pt;font-family:&quot;Swiss721BT-Light&quot;,sans-serif;mso-bidi-font-family:\nSwiss721BT-Light\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><sup><span style=\"font-size:14.0pt;line-height:107%\">1 </span></sup><span style=\"font-size:14.0pt;line-height:107%\">Prof. Tarek salah, <sup>2</sup> Ahmed\nMagdy, <sup>3 </sup>Ahmed Samir, <sup>4 </sup>Poula Adel, <sup>5 </sup></span><span style=\"font-size:14.0pt;line-height:107%;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">Esraa Raafat</span><span style=\"font-size:14.0pt;line-height:107%\">,<sup> 6 </sup>Zeyad Ahmed <sup>7 </sup>Eman\nTaha, <sup>8</sup> Ahmed Saber<o:p></o:p></span></p>\n\n<div style=\"mso-element:para-border-div;border:none;border-bottom:solid windowtext 1.0pt;\nmso-border-bottom-alt:solid windowtext .75pt;padding:0in 0in 1.0pt 0in\">\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:200%;\nborder:none;mso-border-bottom-alt:solid windowtext .75pt;padding:0in;\nmso-padding-alt:0in 0in 1.0pt 0in\"><i><span style=\"font-size:10.0pt;line-height:\n200%\">Faculty of Computers and Information, Modern university for information\nand technology, Cairo, Egypt<o:p></o:p></span></i></p>\n\n</div>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:10.0pt\">ABSTRACT</span></b><b><span style=\"font-size:10.0pt;\nfont-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi\">: </span></b><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi\">Next-word\nprediction is a fundamental task in natural language processing and has many\npractical applications. In this paper, we propose a next-word prediction model\nbased on a Bidirectional LSTM with a GRU layer..Our model incorporates\nattention mechanisms and is trained on a large corpus of text data. We evaluate\nthe performance of our model on two standard datasets and show that it\noutperforms existing state-of-the-art models on both datasets.</span> <span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi\">and\nshow that it outperforms existing state-of-the-art models on both datasets.</span>\n<span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi\">We\nalso introduce a reporting system that provides information about the\nperformance of the model during training and testing</span><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\"><o:p></o:p></span></p>\n\n<div style=\"mso-element:para-border-div;border:none;border-bottom:solid windowtext 1.0pt;\nmso-border-bottom-alt:solid windowtext .75pt;padding:0in 0in 1.0pt 0in\">\n\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%;border:none;\nmso-border-bottom-alt:solid windowtext .75pt;padding:0in;mso-padding-alt:0in 0in 1.0pt 0in\"><b><span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Keywords:</span></b>\n<span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Next\nword prediction, BI-LSTM model, GRU model, Report system.<o:p></o:p></span></p>\n\n</div>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1</span>. &nbsp;INTRODUCTION<o:p></o:p></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">The word prediction project is an exciting new initiative that seeks to\nrevolutionize the way people communicate. By leveraging the power of artificial\nintelligence, this project aims to create a system that can accurately predict\nwhat words a person is likely to use next in a conversation. This system will\nbe able to learn from past conversations and use this data to make more\naccurate predictions about what words are likely to be used in future\nconversations.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">The goal of this project is twofold: first, it seeks to improve the\naccuracy of word prediction by using machine learning algorithms; second, it\nseeks to make communication more efficient by reducing the amount of time spent\nsearching for the right words. By predicting what words are likely to be used\nnext, users can save time and energy when engaging in conversations.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">To achieve these goals, the project will employ several different\ntechniques. First, it will use natural language processing (NLP) algorithms to\nanalyze past conversations and identify patterns in how people communicate.\nThis data will then be used as input for machine learning algorithms which will\ngenerate predictions about what words are likely to be used next in a\nconversation. Additionally, the project will also employ deep learning\ntechniques such as Gated Recurrent Unit (GRU) and long short-term memory\n(Bi-LSTM) networks which can learn from large amounts of text data and generate\nmore accurate predictions than traditional NLP algorithms.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">The project team consists of experts from various fields including\ncomputer science, linguistics, and artificial intelligence. The team is\ncurrently working on developing an algorithm that can accurately predict what\nwords are likely to be used next in a conversation based on past conversations.\nOnce this algorithm is developed, it will be tested on real-world conversations\nbefore being released into production. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-f