age using\ntheir own secondary storage devices.<o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-.25in;\nline-height:150%;mso-list:l0 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span dir=\"LTR\"></span><span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">Create a cost-free Cloud storage platform so\nthat user can transfer files through the internet and add storage as needed without\nhaving to pay money for it.<o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-indent:-.25in;\nline-height:150%;mso-list:l0 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span dir=\"LTR\"></span><span style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">Assuring That the system is completely\nsecure as the storage devices (hard disk drives) are completely in control of\nthe user, and only access the data by entering username and password to access\nthe system, with added security features involving encryption and hashing.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><b><span style=\"font-size:10.0pt;line-height:107%\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b>3. &nbsp;LITERATURE REVIEW<o:p></o:p></b></p>\n\n<p style=\"margin: 6pt 0in 0in; text-indent: 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n11.0pt;color:black;mso-color-alt:windowtext\">This section describes the\nmethodology adopted for the literature review.</span><span style=\"font-size:\n11.0pt\"><o:p></o:p></span></p>\n\n<p style=\"margin: 6pt 0in 0in; text-indent: 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n11.0pt\">&nbsp;</span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-left:.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;line-height:150%;mso-list:l2 level1 lfo3\"><!--[if !supportLists]-->1-<span style=\"font-variant-numeric: norm