ight\" anchorx=\"margin\"/>\n</v:shape><![endif]--><!--[if !vml]--><img width=\"346\" height=\"161\" src=\"file:///C:/Users/mzmz/AppData/Local/Packages/oice_16_974fa576_32c1d314_22ea/AC/Temp/msohtmlclip1/01/clip_image002.jpg\" align=\"left\" hspace=\"12\" v:shapes=\"Picture_x0020_23\"><!--[endif]-->Recurrent Neural Networks (RNNs) are a type of\nartificial neural network that are used to process sequential data. They are\ncapable of learning from past inputs and can remember information over long\nperiods of time. RNNs have an internal memory that allows them to remember past\ninputs and use them to inform future decisions. This makes them ideal for tasks\nsuch as language translation, speech recognition, and text generation. RNNs can\nbe used for both supervised and unsupervised learning tasks, making them a\npowerful tool in the field of machine learning.<o:p></o:p></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><o:p>&nbsp;</o:p></p>\n\n<p style=\"margin: 6pt 0in 0in 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; text-indent: 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n11.0pt\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; text-indent: 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n11.0pt\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt\">&nbsp;</span></p>\n\n<p align=\"center\" style=\"margin: 6pt 0in 0.25in; text-align: center; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG\">Fig.1</span></b><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG\"> Recurrent Neural\nNetwork</span><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;line-height:150%;mso-list:l2 level1 lfo3\"><!--[if !supportLists]-->2-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\n</span><!--[endif]--><span dir=\"LTR\"></span>Long Short-Term Memory (LSTM) is a type of Recurrent Neural Network\n(RNN) architecture that is capable of learning long-term dependencies. It is\ncomposed of memory blocks that contain information from previous inputs and can\nbe used to predict future outputs. LSTMs are commonly used in natural language\nprocessing, speech recognition, and time series forecasting tasks.<o:p></o:p></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.75in;mso-add-space:\nauto;text-align:justify;line-height:150%\"><!--[if gte vml 1]><v:shape id=\"Picture_x0020_24\"\n o:spid=\"_x0000_s1027\" type=\"#_x0000_t75\" style=\'position:absolute;left:0;\n text-align:left;margin-left:118.5pt;margin-top:7.3pt;width:240pt;height:131.9pt;\n z-index:-251655168;visibility:visible;mso-wrap-style:square;\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\n mso-position-horizontal-relative:margin;mso-position-vertical:absolute;\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\n mso-width-relative:margin;mso-height-relative:margin\'>\n <v:imagedata src=\"file:///C:/Users/mzmz/AppData/Local/Packages/oice_16_974fa576_32c1d314_22ea/AC/Temp/msohtmlclip1/01/clip_image003.png\"\n  o:title=\"\"/>\n <w:wrap type=\"tight\" anchorx=\"margin\"/>\n</v:shape><![endif]--><!--[if !vml]--><img width=\"320\" height=\"176\" src=\"file:///C:/Users/mzmz/AppData/Local/Packages/oice_16_974fa576_32c1d314_22ea/AC/Temp/msohtmlclip