e for each direction, to capture information\nfrom both directions in the input sequence. This allows the model to better\nunderstand the context of the input sequence and make more accurate\npredictions. Bi-LSTMs are often used in tasks such as sentiment analysis and\nlanguage translation where understanding context is important.</span><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p style=\"margin: 6pt 0in 0.25in 0.75in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.0pt;\nmso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:major-bidi;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0.25in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.0pt;\nmso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:major-bidi;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt\">&nbsp;</span></p>\n\n<p style=\"margin: 6pt 0in 0in; text-indent: 0.5in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n16.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:major-bidi;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;color:black;mso-color-alt:windowtext;mso-bidi-language:\nAR-EG\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:16.0pt;\nmso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:major-bidi;\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p align=\"center\" style=\"margin: 6pt 0in 0.25in; text-align: center; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG\">Fig.3 </span></b><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG\">BI-LSTM</span><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p style=\"margin-left: 0.75in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\nmso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p style=\"margin-left: 1in; text-align: justify; text-indent: -0.25in; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-ascii-theme-font:\nmajor-bidi;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-theme-font:\nmajor-bidi;mso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">4-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span dir=\"LTR\"></span><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG\">&nbsp;&nbsp;Gated\nRecurrent Unit (GRU) is a type of neural network architecture used in the field\nof deep learning for processing sequential data. It is a variant of the more\ncommonly used Recurrent Neural Network (RNN) architecture.Like RNNs, GRUs are\ndesigned to work with sequential data such as time series or natural language.\nHowever, unlike RNNs, GRUs have a gating mechanism that allows them to\nselectively update and reset their internal state, making them more efficient\nat handling long-term dependencies in the input data.&nbsp; The key difference between GRUs and\ntraditional RNNs is that GRUs have two gates, an update gate and a reset gate,\nwhich are used to control the flow of information through the network. The\nupdate gate controls how much of the previous state should be carried forward\nto the current state, while the reset gate determines how much of the previous\nstate should be forgotten.</span><span style=\"font-size:10.0pt;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-ascii-theme-font:major-bidi;mso-fareast-font-family:Calibri;\nmso-fareast-theme-font:minor-latin;mso-hansi-font-family:&quot;Times New Roman&quot;;\nmso-hansi-theme-font:major-bidi;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p align=\"center\" style=\"margin-left: 1in; text-align: center; line-height: 20.05pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.0pt;mso-ascii-font-family:&quot;Times New Roman&quot;;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\nminor-latin;mso-hansi-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-bidi;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\ncolor:black;mso-color-alt:windowtext;mso-bidi-language:AR-EG;mso-no-proof:yes\"><!--[if gte vml 1]><v:shape\n id=\"Picture_x0020_4\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Diagram, schematic&#10;&#10;Description automatically generated\"\n style=\'width:269.4pt;height:135.6pt;visibility:visible\' o:gfxdata=\"UEsDBBQABgAIAAAAIQA0Ev94FAEAAFACAAATAAAAW0NvbnRlbnRfVHlwZXNdLnhtbKSSy07DMBBF\n9