ustify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">Our proposed\nmodel consists of a Bidirectional LSTM layer followed by a GRU layer and a\nsoftmax layer. The Bidirectional LSTM layer is used to capture both the forward\nand backward dependencies in the input text. The GRU layer is used to control\nthe flow of information within the network by selectively allowing or blocking\ninformation from the previous time step. The softmax layer is used to compute\nthe probability distribution over the vocabulary of possible next words.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">The proposed solution consists of the following:<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">1-Capturing Contextual Information: Bi-LSTM models are effective in\ncapturing the contextual information of the input sequence, which is important\nin predicting the next word in a sentence. By processing the input sequence in\nboth forward and backward directions<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">2-</span> <span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">Handling Long-Term Dependencies: Bi-LSTM\nmodels can handle long-term dependencies in the input sequence, which is useful\nin predicting the next word in a sentence. By using LSTM cells, which are\ndesigned to remember information over longer periods of time, Bi-LSTM models\ncan capture dependencies between words that are far apart in the input\nsequence.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">3-</span> <span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">Robustness to Variations in Input: Bi-LSTM\nmodels are robust to variations in input, such as misspellings or variations in\nword order. This is because the model can use the context of the input sequence\nto predict the next word, rather than relying solely on the specific input\ntokens.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">4-</span> <span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">Short-term memory: GRUs are designed to\nmaintain a short-term memory of the previous words in a sequence. This enables\nthem to capture dependencies between words that are close to each other in the\nsequence.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">5- Computationally efficient: GRUs are computationally efficient\ncompared to other recurrent neural networks like long short-term memory (LSTM)\nnetworks, which makes them faster to train and run.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">6- Fewer parameters: GRUs have fewer parameters than LSTMs, which makes\nthem easier to train and less prone to overfitting.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">7- flexible architecture: GRUs can be easily adapted to different tasks\nand data types, such as text, speech, and images.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">8- Good\nperformance: GRUs have been shown to perform well in various natural language\nprocessing tasks, including next word prediction.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b>5. PROPOSED\n</b><b>METHODOLGY<o:p></o:p></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;mso-layout-grid-align:none;\ntext-autospace:none\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">5.1 &nbsp;</span><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi\">Data\nPre-processing: It’s necessary to remove undesired data from the dataset </span><span lang=\"EN-GB\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-ansi-language:EN-GB\">(such as rows with missing values).</span><span lang=\"EN-GB\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi\"> </span><span lang=\"EN-GB\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-ansi-language:EN-GB\">Create a vocabulary of all unique words in the\ntraining data and assign each word a unique integer index. This is necessary\nfor converting the input and output sequences into numerical form.Data\nnormalization: Normalize the input data to have zero mean and unit variance.\nThis can improve the convergence of the model during training.</span><span lang=\"EN-GB\" style=\"font-size:24.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:major-bidi;\nmso-bidi-theme-font:major-bidi;color:black;mso-themecolor:text1;mso-font-kerning:\n12.0pt;mso-ansi-language:EN-GB\"> </span><span lang=\"EN-GB\" style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-ansi-language:EN-GB\">If features\nhave very&nbsp;different ranges we should normalize the features (make them\nhave the same range)<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;mso-layout-grid-align:none;\ntext-autospace:none\"><span lang=\"EN-GB\" style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-ansi-language:EN-GB\">5.2&nbsp;\n3-Gram Model: consider three preceding words, which provide a better\ncontext for predicting the next word. can improve the accuracy of next word\nprediction compared to simpler models that consider only one or two preceding\nwords.</span><span lang=\"EN-GB\"> </span><span lang=\"EN-GB\" style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-ansi-language:EN-GB\">3-gram models reduce sparsity compared to\nhigher-order n-gram models (e.g., 4-gram or 5-gram), which require more\ntraining data to avoid underfitting.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-layout-grid-align:\nnone;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">6- </span></b><b>THE MODEL ARCHITECTURE</b><b><span style=\"font-size:10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\"><o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model = Sequential()<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Embedding(vocab_size, 100, input_length=3))&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; # input dim #output dim&nbsp;&nbsp; # input length <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Bidirectional(LSTM(units=1000,return_sequences=True,)))<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Dropout(0.5))<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(GRU(units=1000,))&nbsp; # Set\nreturn_sequences=False because no layers will add <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Dropout(0.5))<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Dense(1000, activation=\'relu\'))&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; # relu any negtive value will be 0\nand any positive will be positive <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.add(Dense(vocab_size, activation=\'softmax\'))&nbsp; # output will be in our unique word and\nsoftmax to probability to know the output <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">model.summary()<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">6. EXPERIMENTS AND TESTING<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\">•Trying to create model using\ncustom dataset contains 20000 words which will predict users next word in\nreporting system after the users typed 3 words, the model will understand 3\nwords and predict upcoming word. <span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\">• This product has more scope on\nfield of psychiatry for syntax analysis and semantic analysis in natural\nlanguage processing in Artificial intelligence.<o:p></o:p></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\">• We trained our model with 1000\nneurons and 60 epochs. It take around 55 mins to finish its training and the\nprediction has accuracy 94.06% .<o:p></o:p></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-size:10.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-no-proof:yes\"><!--[if gte vml 1]><v:shape id=\"Picture_x0020_3\"\n o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" style=\'width:373.2pt;height:219pt;\n visibility:visible;mso-wrap-style:square\'>\n <v:imagedata src=\"file:///C:/Users/mzmz/AppData/Local/Packages/oice_16_974fa576_32c1d314_22ea/AC/Temp/msohtmlclip1/01/clip_image009.jpg\"\n  o:title=\"trainning graph\"/>\n</v:shape><![endif]--><!--[if !vml]--><img width=\"498\" height=\"292\" src=\"file:///C:/Users/mzmz/AppData/Local/Packages/oice_16_974fa576_32c1d314_22ea/AC/Temp/msohtmlclip1/01/clip_image010.jpg\" v:shapes=\"Picture_x0020_3\"><!--[endif]--></span><o:p></o:p></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\n\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:\nmajor-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;\nmso-bidi-language:AR-EG\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0in;margin-right:0in;\nmargin-bottom:0in;margin-left:.25in;text-align:center;line-height:normal;\nmso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">7. RESULTS<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0in;margin-right:0in;\nmargin-bottom:0in;margin-left:.25in;text-align:center;line-height:normal;\nmso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-family:\n&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;mso-hansi-theme-font:\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;text-align:justify;line-height:\nnormal;mso-layout-grid-align:none;text-autospace:none\"><span style=\"font-size:\n10.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">We wrote a report to test our project, when we initially entered 3 words\nas input, the model predicted the next word as output and took the predicted\nword as new input and predicted the appropriate next word according to it</span><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">. <o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;text-align:center;\nline-height:normal;mso-layout-grid-align:none;text-autospace:none\"><b><span style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\nmso-hansi-theme-font:major-bidi;mso-bidi-theme-font:major-bidi;mso-bidi-language:\nAR-EG\">&nbsp;</span></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span><span style=\"font-size:10.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;\nmso-ascii-theme-font:major-bidi;mso-hansi-theme-font:major-bidi;mso-bidi-theme-font:\nmajor-bidi;mso-bidi-language:AR-EG\">&nbsp;</span></p>', NULL, '2023-06-17 08:02:17');

